(9473, NULL, NULL, 9004, 'THERMO', NULL, NULL, 'C', NULL, '2014-12-03 00:00:00', NULL, 'Sidestep delays introduced upon interruption of a Network Drive connection (tested by shutting down or turning off the shared network drive).  Significant delays in such cases came about when checking the mountpoint for an active share when the connection had been disrupted.  When a connection is disrupted like this, it takes roughly 10 seconds before the mountpoint command will return a \"Host is down\" message, which in turn tied up communication with the device and introduced delays in page loads at the Run and System Preferences pages specifically.  With the code variances put in place here, using timeouts where needed, such delays do not occur when multiple web browser windows are opened showing two or more Run and/or System P', '9:05a-9:45', NULL, 40, NULL, NULL, NULL, NULL, 127, 1, NULL, '2014-12-03 00:00:00', '2014-12-02 17:00:00', NULL),
(9474, NULL, NULL, 9004, 'THERMO', NULL, NULL, 'C', NULL, '2014-12-03 00:00:00', NULL, 'Test use cases where a Network Drive connection is disrupted and an attempt is made to reconnect to the same share or another share without first doing a device Restart.', '10:20a-10:50', NULL, 30, NULL, NULL, NULL, NULL, 127, 1, NULL, '2014-12-03 00:00:00', '2014-12-02 17:00:00', NULL),
